DROP TABLE IF EXISTS Avis CASCADE;
DROP TABLE IF EXISTS Categorie CASCADE;
DROP TABLE IF EXISTS Film CASCADE;
DROP TABLE IF EXISTS Utilisateur CASCADE;

CREATE TABLE Avis(
                     IdFilm int NOT NULL,
                     IdUtilisateur int NOT NULL,
                     commentaire varchar(1000) NULL,
                     note numeric NOT NULL,
                     CONSTRAINT PK_Avis PRIMARY KEY (IdFilm, IdUtilisateur)
);

CREATE TABLE Categorie(
                          IdCategorie int GENERATED BY DEFAULT AS IDENTITY,
                          nom varchar(50) NOT NULL,
                          description text NULL,
                          CONSTRAINT PK_Categorie PRIMARY KEY (IdCategorie)
);

CREATE TABLE Film(
                     IdFilm int GENERATED BY DEFAULT AS IDENTITY NOT NULL,
                     nom varchar(50) NOT NULL,
                     description text NULL,
                     IdCategorie int NOT NULL,
                     CONSTRAINT PK_Film PRIMARY KEY (IdFilm)
);

CREATE TABLE Utilisateur(
                            IdUtilisateur int GENERATED BY DEFAULT AS IDENTITY NOT NULL,
                            login varchar(50) NOT NULL,
                            email varchar(100) NOT NULL,
                            pwd varchar(64) NOT NULL,
                            CONSTRAINT PK_Utilisateur PRIMARY KEY (IdUtilisateur)
);



